import React from 'react';


function Button(props) {
    const {onChangeNumber} = props

    handleOnChange = () => {
        onChangeNumber()
    }

    return (
        <div>
            <button class="btn btn-dark" onClick={handleOnChange}>Get number</button>
            <button class="btn btn-dark">Reset</button>
        </div>
    );
}

export default Button;
